import React from "react";
import Button from './Button'

export default class Dashboard extends React.Component {
  constructor() {
    super();
    this.state = {};
  }
  render() {
    return <div>
      <Button>Choose package</Button>
      <Button>Add one from active package</Button>
    </div>;
  }
}
